#include <stdbool.h>
#include <time.h>
#include <stdio.h>

double time_taken;

void swap(int *a, int *b)
{
    int temp = *a;
    *a = *b;
    *b = temp;
}

void selectionSort(int A[], int n)
{
    int i, j, min_index;
    clock_t initial, final;

    // initial processor time
    initial = clock();

    for (i = 0; i < n; i++)
    {
        min_index = i; // assume the minimum element is ith element
        // compare the minimum with the elements to the right of it
        for (j = i + 1; j < n; j++)
        {
            // change the minimum index if another element is smaller than current minimum
            if (A[j] < A[min_index])
            {
                min_index = j;
            }
        }
        // swap the found minimum with the ith element
        swap(&A[min_index], &A[i]);
    }

    // initial processor time
    final = clock();
    // total time taken by the sorting in seconds
    time_taken = (double)(final - initial) / CLOCKS_PER_SEC;
}

